import React from 'react'
import img from '../img/짭쥐 표지-18_cut.png'

const Main = () => {

  const back = {
    display: 'flex',
    justifyContent: 'center',
    bottom:0,
    width:'100vw',
    height:'20vw',
    backgroundColor:'#3e448b'
  }

  return (
    <div>
      <div style={back}>
        <img src={img} style={{width:'100vw', }}/>
      </div>
    </div>
  )
}

export default Main
